import React, { Component } from "react";

class WidgetList extends Component {
  state = {
    languages: [
      {
        id: 0,
        name: "JavaScript",
        count: 0,
      },
      {
        id: 1,
        name: "Python",
        count: 0,
      },
      {
        id: 2,
        name: "Go",
        count: 0,
      },
      {
        id: 3,
        name: "Java",
        count: 0,
      },
      {
        id: 4,
        name: "Typescript",
        count: 0,
      },
      {
        id: 5,
        name: "Ruby",
        count: 0,
      },
      {
        id: 6,
        name: "Elixir",
        count: 0,
      },
    ],
  };

  createWidgetItem = () => {
    return document.createElement("li").innerHTML = `<button className="language">${this.state.languages}</button>`;
  }

  render() {
    return (
        <div>
            <ul className="languages">
                <button onClick={this.createWidgetItem}>Hi</button>
            </ul>
        </div>
    )
  }
}

export default WidgetList;
